(5, '## 1   Senatsverwaltung für Umwelt, Verkehr und Klimaschutz   Herrn Abgeordneten Andreas Otto (GRÜNE) über den Präsidenten des Abgeordnetenhauses von Berlin   über Senatskanzlei G Sen   **A n t w o r t auf die Schriftliche Anfrage Nr. 19/10006 vom 04.11.2021 über Wann kommen die Solaranlagen nach Pankow?**   Im Namen des Senats von Berlin beantworte ich Ihre Schriftliche Anfrage wie folgt:   Vorbemerkung der Verwaltung: Die Schriftliche Anfrage betrifft Sachverhalte, die der Senat nicht aus eigener Zuständigkeit und Kenntnis beantworten kann. Er ist gleichwohl bemüht, Ihnen eine Antwort auf Ihre Anfrage zukommen zu lassen und hat daher das Bezirksamt Pankow um Stellungnahme gebeten, die von dort in eigener Verantwortung erstellt und dem Senat übermittelt wurde. Sie wird in der Antwort an den entsprechend gekennzeichneten Stellen wiedergegeben.   Frage 1:   Wie ist der Arbeitsstand bei der Umsetzung der Forderung aus dem § 19 des Berliner Klimaschutzund Energiewendegesetzes (EWG Bln), auf Dächern öffentlicher Gebäude spätestens bis zum 31. Dezember 2024 Solaranlagen auf der gesamten technisch nutzbaren Dachfläche zu errichten, im Bezirk Pankow?   Antwort zu 1:   Das Bezirksamt Pankow teilt hierzu mit: „Bei allen Maßnahmen werden entsprechende Vorbereitungen für eine nachträgliche Installation einer PV-Anlage (PV-Readiness) geplant und innerhalb eines Jahres nach Bauabnahme werden die entsprechend geeigneten Dachflächen mit einer Solaranlage versehen. Vereinzelte Maßnahmen werden bereits mit einer PV-Anlage geplant, so dass mit der Bauabnahme auch die PV-Anlage in Betrieb genommen ist.“    ', '[0.027720345,-0.017728128,-0.0035875286,-0.028983878,-0.0056762244,0.018695118,-0.0040226732,-0.00957319,-0.035946198,0.010978546,0.031253077,0.0012296875,-0.030634206,0.008335443,-0.009508723,-0.0006140379,0.028158715,0.0037615865,0.0055698557,0.0049445364,-0.0063402234,-0.0014996385,-0.0014480657,0.009721461,0.019455815,-0.018720904,0.006204845,-0.03380593,-0.022163384,-0