(6, '## 2   Frage 2:   Welche öffentlichen Gebäude im Sinne des o.g. §19 EWG Bln befinden sich im Bezirk Pankow?   Antwort zu 2:   Das Bezirksamt Pankow teilt hierzu mit: „Es gibt ca. 257 öffentliche Gebäude im Sinne des § 19 EWG Bln im Bezirk Pankow.“   Frage 3:   Welche Verfügungsberechtigten (z.B. Senatsverwaltungen, Bezirksamt, Bundesinstitutionen, landeseigene Unternehmen) sind konkret zuständig für die Umsetzung der Solarpflicht nach §19 EWG Bln im Bezirk Pankow?   Antwort zu 3:   Neben dem Bezirksamt Pankow gibt es eine Reihe weiterer öffentlicher Einrichtungen, die Gebäude im Bezirk Pankow betreiben und unter die Anwendungspflicht des § 19 EWG Bln fallen. Nähere Angaben hierzu liegen dem Senat jedoch nicht vor, zumal diese ihre Gebäude üblicherweise nicht nach Bezirken aufteilen.   Frage 4:   Wie groß schätzt der Senat die Summe der o.g. Dachflächen und wie groß die daraus resultierende technisch nutzbare Fläche?   Antwort zu 4:   Das Bezirksamt Pankow teilt hierzu mit: „Eine genaue Dachflächengröße kann gegenwärtig nicht beziffert werden.“   Frage 5:   Welcher Anteil der o.g. Dachflächen ist bereits heute mit Solaranlagen belegt?   Antwort zu 5:   Das Bezirksamt Pankow teilt hierzu mit: „Es wurden bisher ca. 29.000 m² der Dachflächen mit Solaranlagen belegt.“   Frage 6:   Welcher Anteil der o.g. Dachflächen soll jeweils in den Jahren 2022/2023/2024 mit Solaranlagen belegt werden?    ', '[0.023524951,-0.0013554036,0.00959383,-0.030425778,-0.024910295,0.010364185,-0.00739929,-0.013154293,-0.038893204,-0.0005097936,0.021738246,0.0015285716,-0.021660564,0.0052403547,-0.013374395,0.012299782,0.019770281,-0.005984815,0.004224004,0.020624792,-0.013070137,-0.008486849,0.0038906152,0.001315753,-0.0010236332,-0.0018854272,0.009419044,-0.024651352,-0.022463286,0.003204417,0.0015746958,-0.027577406,-0.02330485,0.015782563,-0.004884308,-0.013685126,0.005356879,0.001410429,0.022320868,0.0034633598,0.012817668,0.017750528,0.00961325,-0.023809789,0.010959753,0.0071532945,0