	VALUES (2, 'Das Bezirksamt Pankow plant, bis zum 31. Dezember 2024 Solaranlagen auf allen technisch nutzbaren Dachflächen öffentlicher Gebäude zu installieren. Es gibt etwa 257 solcher Gebäude im Bezirk Pankow. Das Bezirksamt ist für die Umsetzung der Solarpflicht zuständig, aber es gibt auch andere öffentliche Einrichtungen, die Gebäude im Bezirk betreiben und unter die Solarpflicht fallen. Die genaue Größe der Dachflächen ist derzeit nicht bekannt, aber bisher wurden etwa 29.000 m² mit Solaranlagen belegt. Für die Jahre 2021 und 2022 wurden Verträge für 24 PV-Anlagen abgeschlossen, und es werden weitere geeignete Dachflächen gesucht.', '[0.026208855,-0.014990959,0.008748947,-0.026664661,-0.029981919,0.018827328,-0.018498134,-0.009299712,-0.022347165,0.0015470505,0.03727482,0.009014834,-0.019700956,0.011103945,-0.013509589,0.014661766,0.033527076,-0.009793502,-0.00020495451,-0.0006564084,-0.012148501,-0.0048049567,-0.013319669,0.00041228303,0.0109013645,0.0041402397,0.013762815,-0.025626436,-0.010097373,-0.006957375,0.023562647,-0.021562165,-0.025309905,0.00606792,-0.007660076,-0.014269266,0.008616003,0.00053889584,0.009654229,0.009337696,0.012857533,0.0035071755,0.0061533838,-0.027323049,0.0123067675,0.0013523833,0.017586522,0.009211083,-0.03347643,0.045605943,0.012604307,0.04335223,-0.011971243,-0.0019118537,-0.018599425,-0.013243702,-0.009021164,0.006552214,-0.0228916,-0.014218621,-0.0027047666,-0.018599425,-0.0026636175,0.00043483594,-0.033045948,0.0052354406,-0.030336434,0.006545883,-0.008932536,-0.0075144717,0.047429167,0.03208369,0.018004345,-0.02517063,0.01164205,-0.0103316065,0.02643676,0.0073562055,-0.025575792,0.010337938,0.012781565,-0.037933204,-0.02062523,0.04659352,0.016522974,0.00681177,-0.011559752,0.045859165,-0.0047226585,0.015839266,0.015813943,0.013661524,-0.0027316718,0.006029936,-0.010198663,0.012199146,0.0078689875,0.0033014296,0.01164205,-0.014775718,0.0031653207,0.015294829,-0.006273666,-0.0025243433,-0.024651518,9.599824e-05,0.011762332,